import React from 'react';
import Navbar2 from '../Layout/Navbar2';
import PlacesList from '../Layout/Places/PlacesList';

const Presence = () => {
	return (
		<>
			<Navbar2 />
			<PlacesList />
		</>
	);
};

export default Presence;
